import React from "react";
import styled from "styled-components";

import "../css/Footer.css";
import logo from "../assets/logo.png";
const Lines = styled.div`
  width: 100%;
  height: 1px;
  background: black;
  border-radious: 50%;
`;

const Footer = () => {
  return (
    <div className="container" style={{ background: "#eeeeee" }}>
      <div className="leftMenu">
        {/* <div className="title">포항연탄은행</div> */}
        <div className="logo">
          <img src={logo} alt="Logo" />
        </div>
        <div className="left-content">
          전화 : 054-243-2777
          <br />
          팩스 : 054-491-0339
          <br />
          대표 : 유호범 | 고유번호 : 506-82-77056
          <br />
          경북 포항시 북구 흥해읍 한동로 513번길 43-1 (37553)
        </div>
      </div>

      <div className="rightMenu">
        <div className="title">바로 가기</div>
        <div className="right-content">
          <div className="right-content-1">
            <div className="right-content-title">포항연탄은행</div>
          </div>
          <div className="right-content-2"></div>
          <div className="right-content-3"></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
